-- to run: mysql -u root < schema.sql
DROP DATABASE IF EXISTS project_nomad_carousel;

CREATE DATABASE project_nomad_carousel;

USE project_nomad_carousel;



CREATE TABLE LISTINGS (
  id INT NOT NULL PRIMARY KEY,
  name TEXT NOT NULL

);



CREATE TABLE REFRENCEPIC (
    id INT NOT NULL PRIMARY KEY,
    listing_id INT NOT NULL ,
    caption TEXT NOT NULL,
    verifiablePhoto boolean NOT NULL,
    src TEXT NOT NULL

);































